Amazing Spaces: Shed of the Year Series 1

Technology Documentary hosted by George Clarke, published by Channel 4 in 2014 - English narration


Information
------------------------------

Amazing Spaces: Shed of the Year
George Clarke discovers what is really happening in the Great British shed with the Shed of the Year competition - from an intricate shell grotto inside a war bunker to a disco shed that plays the biggest festivals in the country. 
There's also a Dad's Army enthusiast who's built an entire museum full of memorabilia and a man who's converted his shed into a 1970s amusement arcade. 
George travels the length and breadth of the British Isles with his Amazing Spaces team of master craftsman Will Hardie, designer Max McMurdo and architect Laura Jane Clarke. At the end of the series the very best design will be crowned Shed of the Year. 
The competition is split into categories - Unique, Normal, Eco, Cabin &amp; Summerhouse, Workshop &amp; Studio, Garden Office, Pub and Tardis.


1)  Unique and Eco Sheds 
The first episode includes the Unique shed category, which features a 21ft-wide replica of a tea pot, a Titanic museum and a cinema shed with over 3000 films. The Eco category features a garden shed with an allotment built on the roof, a shed made out of 5000 wine bottles, an egg shaped studio and a glass shed built over a pond, which cost just Ã‚Â£250.

2)  Summer House/Cabin and Workshop 
The competition to find the country's best shed continues with the Summerhouse/Cabin group, which throws up a replica 18th century US frontier cabin, a Gothic grotto decorated with 50,000 seashells, and a scaled down Elizabethan lodge. In the Workshop category, a 1930s garage, complete with classic car restorations, battles it out with a graffiti artist's shed with its own gorilla, an extraordinary bird box production line, and the smallest shed in the whole competition: a music venue with room for just one performer and one audience member.

3)  Final: Normal and Pub Sheds 
As the competition to find Britain's best shed reaches its climax, George Clarke and his fellow judges look at the final groups of shortlisted sheds battling it out for a place in the grand final. The 'Normal' sheds prove anything but, with one of the smallest discos in the world up against a Dad's Army themed shed complete with air raid siren, as well as a 1970s amusement park in a shed with a 12-foot working Ferris wheel outside. The judges cast their eyes over the most pleasurable category in the competition, the Pub Shed, before they decide which of them most deserves the overall prize of Shed of the Year 2014.
George also visits last year's winner: an upside-down boat shed.

